import React from 'react';

import ExpenseForm from './ExpenseForm';
import './NewExpense.css';

function NewExpense(){
  function onSaveExpenseData(event) {
    const eventData = {
      title: event.title,
      amount: event.amount,
      date: event.date,
    };
  }
  return (
    <div className='new-expense'>
      <ExpenseForm onSaveExpenseData />
    </div>
  );
}

export default NewExpense;
